import React from 'react'
import { Row, Col } from 'antd';
import { Link } from 'react-router-dom';
import './index.scss'
class Home extends React.Component {
    render() {
        return (<div>
            <Row id='header'>
                <Col className='logo' span={24}>美丽湾</Col>
                <Link to="/catalog" class="top_bt" />
                <Link to="/flow" class="user_btn" />
            </Row>

            {/* //   搜索框 */}
            <Row className="index_search">
                <Col className='index_search_mid' span={24}>
                <span><img src="../../images/home/icosousuo.png"/></span>
                <input type="text" id="search_text" class="search_text" value="请输入您所搜索的商品"></input>
                </Col>
            </Row>
        </div>
        )
    }
}

export default Home;
